import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import Card from "@material-ui/core/Card";
import orange from "@material-ui/core/colors/orange";
import amber from "@material-ui/core/colors/amber";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles(theme => ({
    divider: {
        marginTop: 10,
    },
    desc_card: {
        minHeight: 100,
        background: orange[50],
        padding: 10
    },
    anec_card: {
        minHeight: 100,
        background: amber[200],
        padding: 10,
        fontWeight: "bold",
        fontFamily: "Garamond"
    },
    grid_text: {
        padding: 20
    },
    subheading: {
        fontFamily: 'Garamond',
        fontWeight: 'bold',
        fontStyle: 'italic',
        textDecoration: 'underline',
        marginBottom: 5
    },
    content: {
        fontFamily: 'Garamond',
        fontSize: 17

    }
}));

export default function Guitar() {
    const classes = useStyles();
    return (
        <div>
            <Grid container justify="space-evenly">
                <Grid item xs={5}>
                    <Iframe url="https://www.youtube.com/embed/bwVirkXOSz4"
                            id="Guitar_vid1"
                            display="initial"
                            height="300px"
                            allowFullScreen
                    />
                </Grid>
                <Grid item xs={5}>
                    <Iframe url="https://www.youtube.com/embed/shiSCyZfQlU"
                            id="Guitar_vid2"
                            display="initial"
                            height="300px"
                            allowFullScreen
                    />
                </Grid>
            </Grid>

            <Divider className={classes.divider} variant="middle"/>

            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={7}>
                    <Card raised className={classes.desc_card}>
                        <Typography variant="h6" align='center' className={classes.subheading}>
                            Background
                        </Typography>
                    </Card>
                </Grid>
                <Grid item xs={5}>
                    <Card raised className={classes.anec_card}>
                        <Typography variant="h6" align='center' className={classes.subheading}>
                            Fun Facts
                        </Typography>
                        <Typography variant='body1' gutterBottom className={classes.content}>
                            I am primarily a right-hander but play a <i><b>left-handed guitar</b></i>!<br/>
                            <br/> My older brother and I were both self-taught, and he was a left-hander.
                            I subconsciously picked up the guitar left-handed for the first time, and it was
                            not till much later that I realized!
                        </Typography>
                    </Card>
                </Grid>
            </Grid>
        </div>
    );
}
